import React, {Component} from 'react';  
import './PopUp.css';  

class Popup extends Component {
	constructor(props){
		super(props);
		this.state = {
			pgn_input: ''
		}
	}

	render(){ 
		return (  
			<div className='popup'>  
				<div className='popup_inner'>  
					<h1>{props.text}</h1> 
					<input type="text" placeholder="Enter PGN" onChange={this.changeHandler} id="inputpgn" /> 
					<button onClick={props.closePopup(document.getElementById('inputpgn').value)}>close me</button>  
				</div>  
			</div>  
		);  
	}
}    
	changeHandler = (e) =>{
		// this.setState({pgn_input})
		console.log(e);
	}
export default Popup;
